}
.footer_wrap .footer_box1 .foot_menu02, .footer_wrap .footer_box1 .foot_menu03, .footer_wrap .footer_box1 .foot_menu04 {
  width: 20%;
}
.footer_wrap .footer_box2 {
  margin-top: 50px;
}
.footer_wrap .footer_box2 .foot_menu05 {
