}
.footer_wrap .footer_box2 .foot_menu05_1 {
  width: 20%;
}
.footer_wrap .footer_box2 .foot_menu05_1 select {
  width: 45%;
  text-align: center;
  outline: none;
  background-color: #eee;
  border: 0;
