}
.footer_wrap .footer_box3 {
  width: 100%;
  margin-top: 50px;
}
.footer_wrap .footer_box3 .menu06 {
  display: flex;
}
.footer_wrap .footer_box3 .menu06 .menu06_1 {
  width: 50%;
  text-align: left;
  margin-left: 90px;
}
.footer_wrap .footer_box3 .menu06 .menu06_1 .menu06_desc .foot_span01, .footer_wrap .footer_box3 .menu06 .menu06_1 .menu06_desc .foot_span02 {
  text-decoration: underline;
  font-weight: bold;
  cursor: pointer;
}
.footer_wrap .footer_box3 .menu06 .menu06_2 {
  width: 25%;
  text-align: left;
  padding-left: 50px;
}
.footer_wrap .footer_box3 .menu06 .menu06_2 .cs_box {
  border: 1px solid black;
  text-align: center;
  /* width: 50%; */
  height: 35px;
  line-height: 35px;
  font-size: 22px;
  border-radius: 30px;
  margin-bottom: 20px;
}
.footer_wrap .footer_box3 .menu06 .menu06_2 h4 {
  margin-top: 10px;
  font-size: 20px;
}
.footer_wrap .footer_box3 .menu06 .menu06_2 p.day {
  font-size: 14px;
  margin-top: 10px;
}
.footer_wrap .footer_box3 .menu06 .menu06_3 {
  width: 25%;
}
.footer_wrap .footer_box3 .menu06 .menu06_3 i {
  font-size: 35px;
  margin-left: 30px;
  cursor: pointer;
}
.footer_wrap .footer_box3 .menu06 .menu06_3 i:nth-child(1) {
  margin-left: 0;
}

/**********quick menu***************/
.quick_menu {
  width: 55px;
  border: 1px solid #ccc;
  position: absolute;
  right: 0px;
  top: 0px;
  z-index: 99998;
  background-color: #fff;
  transition: 0.3s;
}
.quick_menu:hover {
  width: 150px;
}
.quick_menu .quick_wrap .quick_box {
  display: flex;
  border-bottom: 1px solid #ccc;
  height: 50px;
  line-height: 50px;
}
.quick_menu .quick_wrap .quick_box:nth-child(4) {
  border-bottom: 0;
}
.quick_menu .quick_wrap .quick_box .quick_icon {
  width: 30%;
  text-align: center;
}
.quick_menu .quick_wrap .quick_box .quick_icon i {
  font-size: 30px;
  color: #999;
  transition: 0.3s;
}
.quick_menu .quick_wrap .quick_box .quick_icon .usericon {
  padding-left: 11px;
  padding-top: 7px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .truck {
  padding-left: 8px;
  padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .boxopen {
  padding-left: 7px;
  padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box .quick_icon .quicksearch {
  padding-left: 10px;
  padding-top: 10px;
}
.quick_menu .quick_wrap .quick_box:hover i {
  color: #002053;
}
.quick_menu .quick_wrap .quick_box .quick_text {
  width: 0%;
  text-align: center;
  overflow: hidden;
}
.quick_menu .quick_wrap .quick_box .quick_text a {
  font-size: 16px;
  display: block;
  width: 100%;
}
.quick_menu .quick_wrap .quick_box .quick_text a:hover {
  color: #002053;
  font-weight: bold;
}
.quick_menu:hover .quick_wrap .quick_box .quick_text {
  /* display: block; */
