}

/*********dir btn*********/
.dir_btn {
  width: 50px;
  line-height: 50px;
  text-align: center;
  position: fixed;
  bottom: 100px;
  right: 0;
  cursor: pointer;
  z-index: 9999;
}
.dir_btn .top_btn {
  width: 50px;
  height: 50px;
  font-size: 35px;
